import App from "./App.vue";
import ErrorPage from "./ErrorPage.vue";
import Page from "./Page.vue";
export default new class Prismic {
    constructor() {
        this.routes = [
            {
              path: "/",
              name: 'App',
              component: App,
            },
            {
              path: "/404",
              component: ErrorPage,
            },
            {
              path: "/who-we-are",
              component: Page,
              slices: [
                'StickyScrollGallery'
              ]
            },
            {
              path: "/cdap",
              component: Page,
              slices: [
                {
                  component: 'TextOnRight'
                },
                {
                  component: 'FloatingCard'
                },
                {
                  component: 'TextAndImage',
                  data: {
                    orientation: "text-on-left",
                    textalign: ""
                  }
                },
                {
                  component: 'FullsizeImage'
                }
              ],
              bg: "light"
            },
            {
              path: "/our-services",
              component: Page,
              slices: [
                {
                  component: 'TextOnRight'
                },
                {
                  component: 'TextAndImage'
                },
                {
                  component: 'TextAndImage'
                },
                {
                  component: 'TextAndImage'
                }
              ],
              bg: "light"
            },
            {
              path: "/:catchAll(.*)",
              component: ErrorPage,
            }
          ];
    }
}
